import React from 'react';
import profileImage from '../../assets/images/busin.png';

const Profile = ({ id, username, email, accountCreationDate, accountCreationTime }) => {
  return (
    <div className="profile-container">
      <div className="profile-header">
        <img src={profileImage} alt="Profile" className="profile-image" />
        <h1 className="profile-username">{username}</h1>
      </div>
      <div className="profile-details">
        <p><span className="detail-label">ID:</span> {id}</p>
        <p><span className="detail-label">Email:</span> {email}</p>
        <p><span className="detail-label">Account Creation Date:</span> {accountCreationDate}</p>
        <p><span className="detail-label">Account Creation Time:</span> {accountCreationTime}</p>
      </div>
    </div>
  );
}

export default Profile;
